import React from "react";
import Card from "./Card";
import Total from "./Total";

const Accordion = (props) => {
  const { items, removeItem, editItem, handleSubmit } = props;

  return (
    <div className="accordion" id="accordionExample">
      <Total items={items} />

      <Card
        items={items}
        type={"Groceries"}
        removeItem={removeItem}
        editItem={editItem}
        handleSubmit={handleSubmit}
      />
      <Card
        items={items}
        type={"House"}
        removeItem={removeItem}
        editItem={editItem}
        handleSubmit={handleSubmit}
      />
      <Card
        items={items}
        type={"Car"}
        removeItem={removeItem}
        editItem={editItem}
        handleSubmit={handleSubmit}
      />
      <Card
        items={items}
        type={"Other"}
        removeItem={removeItem}
        editItem={editItem}
        handleSubmit={handleSubmit}
      />
    </div>
  );
};

export default Accordion;
